(2965, 'New band: Hueye + Debut Single &#12300;Yasashiku Koroshite&#12301;', 'A new band, (4955)/hueye/, will begin activity on March 27th. They used to go by the name Chinsuikeikaku-seaman-&#65279; (&#27784;&#27700;&#35336;&#30011;-&#28023;&#30007;- ) as a session, and after opening and playing with both (1385)/mamireta/ and (1383)/krad/, they are unsurprisingly now signed to [Punch Records](/labels/punch-records/).\n\n\nHueye will also be releasing their first single as soon as they start activities. *&#12300;Yasashiku Koroshite&#12301;*  (*&#12300;&#20778;&#12375;&#12367;&#27578;&#12375;&#12390;&#12301;*) will contain 3 tracks and cost 1,500 yen.\n\n\nhttps://vk.gy/releases/hueye/15395/yasashiku-koroshite/\n\n---\n\n\n(4955)/Hueye/ are:\n\n* Vo. Nao\n* Gu. Kururu [ex-(1046)/durandal/]\n* Ba. ShuN [ex-(2462)/vampire-rose/]\n* Dr. Majyu [ex-(353)/devil-kitty/[DEVIL KITTY]]\n\n[OHP](http://hueye-official.com/)', '2019-02-01 12:43:20', 400, 16540, NULL, NULL, '(277)(14)', '(353)(2462)(1046)(4955)(1383)(1385)(4955)', 'new-band-hueye', 0),
