(2977, 'glamscure new live-limited single &ldquo;Baptisma&rdquo;', '(1403)/glamscure/ will put out a new single for their 4th anniversary.\n\n*Baptisma* will be released on April 22nd at their sponsored event, &#34;Cerimonia&#34; at Ikebukuro CHOP. Also participating are the members&#39; own session bands ((5361)/st2/, VIDEO Nanchara(&#63;) (&#12532;&#12451;&#12487;&#12458;&#12394;&#65279;&#12435;&#12385;&#12419;&#12425;)), plus (1400)/la-veil mizeria/ and (373)/missa-missa/!\n\nVIDEO Nanchara(&#63;) (&#12532;&#12451;&#12487;&#12458;&#12394;&#65279;&#12435;&#12385;&#12419;&#12425;) lineup:\n\n* Vo.Yuya Nagasawa (&#38263;&#28580; &#20305; &#21705;) (ex-(5286)/the hakkin/, (3442)/video glamour/)\n\n* Gt.HARUI (&#12495;&#12523;&#12452;) (glamscure, ex-(3442)/video glamour/)\n\n* Ba.Gin Nagayama (&#27704;&#23665; &#37504;) (HALVERT)\n\n* Dr.Yusuke (&#24736;&#20171;) ((3697)/kalavinka/ (support), ex-(5286)/the hakkin/, (3442)/video glamour/)\n\n![flyer](https://pbs.twimg.com/media/Dyo-ufrUYAETb8e.jpg)\n\nhttps://vk.gy/releases/glamscure/15480/baptisma/', '2019-02-05 17:27:28', 303, 14390, NULL, NULL, '(277)(77)(2)(19)', '(3442)(5286)(3697)(3442)(3442)(5286)(373)(1400)(5361)(1403)', 'glamscure-new-single-baptisma', 0),
