(2985, 'LABAISER new live-limited single &ldquo;Psycho&rdquo;', 'After having released their [first album](https://vk.gy/blog/labaiser-releases-first-new-song-out-of-their-album-folklore/) last month, (1193)/labaiser/ will put out a new single.\n\n*Psycho* will be released as a present to those who appear at the band&#39;s live event, &#34;Contractor&#39;s thanksgiving ~60&#20998;&#38480;&#23450;&#28961;&#26009;&#21336;&#29420;&#20844;&#28436;~&#34; at Shibuya VUENOS on February 7th.\n\nhttps://vk.gy/releases/labaiser/15559/psycho/', '2019-02-06 18:42:14', 303, 11929, NULL, NULL, '(277)(2)(19)', '(1193)', 'labaiser-new-single-psycho', 0),
