(2987, '&#12532;&#12449;&#12540;&#12472;&#12517; (Virge) Album Delays + New Label', '(1228)/virge/ announced on [their blog](https://ameblo.jp/virge-official/entry-12438530537.html) that their upcoming album, **Gracia**, will be delayed for a month: from April 10th until May 22nd.\n\nWith that news also came out that the band is now signed with [Speed-disk Distribution](/labels/speed-disk-distribution/). My guess is that the delay is due to the logistics behind becoming a part of a new label, but hopefully this means it will now be more widely distributed.\n\nhttps://youtu.be/1Ak_ByrRAxg\n\nFurther details about the album have not yet been released.\n\nhttps://vk.gy/releases/virge/14622/gracia/', '2019-02-07 14:43:12', 29, NULL, NULL, NULL, '(7)(83)', '(1228)', 'virge-album-delays-new-label', 0),
(2988, 'RAZOR new maxi-single &ldquo;Undo&rdquo; + 2nd Anniversary Live DVD', '(2630)/razor/ will put out a new maxi-single.\n\n*Undo* will be released in multiple types on March 13th. Type A comes with a DVD for the &#34;Undo&#34; music video, and type B comes with the additional bonus track &#34;NEW ANSWER.&#34;\n\nThe band will also be releasing a 2nd anniversary live DVD on the same day. That will also come in two types, with the limited edition including a bonus live CD and extra footage.\n\nhttps://vk.gy/releases/razor/15618/undo-type-a/\nhttps://vk.gy/releases/razor/15619/undo-type-b/\n\nhttps://vk.gy/releases/razor/15621/razor-2nd-anniversary-oneman-tour-second-minavi-blitz-akasaka-gentei-gouka-ban/\nhttps://vk.gy/releases/razor/15620/razor-2nd-anniversary-oneman-tour-second-minavi-blitz-akasaka-tsuujou-ban/', '2019-02-08 03:18:50', 29, 16861, NULL, NULL, '(277)(2)', '(2630)', 'razor-new-maxi-single-undo', 0),
