(3000, 'Scarlet Valse new full album &ldquo;Metamorphosis&rdquo;', '(2051)/scarlet-valse/ will put out a new full album.\n\n*Metamorphosis* will be released on April 11th. It will also be presold at their live a month prior to the official release.\n\nhttps://vk.gy/releases/scarlet-valse/15803/metamorphosis/', '2019-02-11 02:45:15', 303, 9169, NULL, NULL, NULL, NULL, 'scarlet-valse-new-full-album-metamorphosis', 0),
(3002, '&#128680; VK bandman turned fruit-loving millionaire arrested &#128680;', 'Like many bandmen before him, original vocalist of visual kei band (5172)/RECLENS/ was arrested this week on charges of tax evasion.\n\n![RECLENS in 2011 with original vocalist Misaki.](/images/17197.jpg)\n\n---\n\nMisaki Yuuta (&#19977;&#23822;&#20778;&#22826;), known simply as Misaki (&#12415;&#12373;&#12365;) at the time, was the vocalist of (5172)/RECLENS/ from their formation in 2010 until about mid-2011. He&#39;d apparently done no bands before, and did none afterward.\n\nhttps://youtu.be/AuvHiS9pF1g\n\nPrior to joining that band, he&#39;d *allegedly* founded a company called MEDIA HEARTS (&#12513;&#12487;&#12451;&#12450;&#12495;&#12540;&#12484;) in 2007, when he was just 18. It&#39;s unclear what the company did at the time, how he had enough money to found a company in the first place, or if he&#39;s even telling the truth about having founded it back then. At any rate, after Misaki ended his band activity in 2011, MEDIA HEARTS found success peddling ~~bullshit~~ health drinks of the &ldquo;[this kale will give you energy](https://myfabius.jp/)&rdquo; variety. They even recently opened their FABIUS cafe, which sold cheeseburgers that somehow made you skinty idk.\n\n![&ldquo;This burger made me shit myself!&rdquo;](/images/17199.jpg)\n\nMisaki himself became known as the **&ldquo;green juice prince&rdquo;** (&#38738;&#27713;&#29579;&#23376;) and appeared on several TV shows peddling his wares while looking cute. In the process, he became a millionaire and often boasted on social media about his four horses, having enough credit card points to buy a car, and traveling to other countries on a whim &ldquo;because it was raining in Japan today.&rdquo; \n\nhttps://twitter.com/misakism13/status/1062395524379111424\n\nTrue to form, it appears that the whole time Misaki had been evading his taxes by clamining much less income than he earned, often by &ldquo;paying companies for services&rdquo; and writing it off as a business loss, when in fact he owned those other companies as well. (This is a classic scheme within visual kei, though on a much smaller scale&#12540;labels often pay design companies, livehouses, etc that they themselves own.)\n\nIn total, Misaki Yuuta&#12540;who apparently claimed to make about the same as a minimum wage worker through his various schemes&#12540;is accused of having evaded at least 180,000,000 yen (&asymp; 1,800,000 USD) in taxes.\n\nhttps://twitter.com/misakism13/status/1085555872040796160\n\n---\n\nHave you ever evaded taxes&#63; Do you think Gackt is sweating right now&#63;', '2019-02-14 12:06:57', 1, 17198, NULL, NULL, NULL, NULL, 'vk-bandman-turned-fruit-loving-millionaire-arrested', 0),
(3003, 'SecretGarden changes to new band &#34;NetherGarden122&#34; + new single &ldquo;Phantom Pain&rdquo;', 'As (5347)/nethergarden122/[SecretGarden] will end activities on April 30, they will transition to new band **NetherGarden122** on May 7!\n\nTheir first single, *Phantom Pain* will be released on May 22nd in 2 types. Their free CD, &#34;RED LINE&#34; will also be distributed at various indie stores presumably on the same day.\n\nhttps://vk.gy/releases/nethergarden122/15882/phantom-pain/\nhttps://vk.gy/releases/nethergarden122/15883/phantom-pain-regular\nhttps://vk.gy/releases/nethergarden122/15884/red-line/', '2019-02-14 17:52:31', 400, 17201, NULL, NULL, NULL, NULL, 'nethergarden122-new-single-phantom-pain', 0),
(3006, 'New band: RAKU&times;GAKI', 'New band (5463)/raku-gaki/ has formed on February 16th and they will hold their first oneman live on April 5 at Ikebukuro CYBER.\n\n---\n\n* Vo. ANNIE (&#12450;&#12491;&#12451;) [ex-(3290)/amanjaku/]\n* Gu. Shoya (&#32724;&#20063;) [ex-(3290)/amanjaku/]\n* Gu. taiga [ex-(3290)/amanjaku/]\n* Dr. Aya (&#32190;) [ex-(3290)/amanjaku/]\n\nTheir first single, *Chu Chu Cherry Vamp&#65279;ir&#65279;e&#65279;*  (*&#12481;&#12517;&#12540;&#12481;&#12517;&#12540;&#12481;&#12455;&#12522;&#12540;&#12532;&#12449;&#12531;&#12497;&#12452;&#12450;*), will be released in multiple types on April 10th.\n\nhttps://vk.gy/releases/raku-gaki/15900/chu-chu-cherry-vamp-ir-e-type-a/\nhttps://vk.gy/releases/raku-gaki/15901/chu-chu-cherry-vamp-ir-e-type-b/', '2019-02-16 19:00:50', 400, 17240, NULL, NULL, NULL, NULL, 'new-band-raku-gaki', 0),
(3008, 'Details for La&#39;veil MizeriA&#39;s First Album Revealed', '(1400)/la-veil mizeria/ are releasing their first album this March, and details regarding the release are finally available.\n\n\nThe album will contain 13 tracks, some of which have already been released on their previous singles. It will cost 3,240 yen and will be limited to 999 physical copies. An interesting thing to note is that a lot of the new songs on this album are actually the names of previously released singles, but were never the names of the songs on featured on said singles. Their minds...!\n\nThey&#39;ve also upload a sampler video that shows brief snippets of two of their upcoming music videos:\n\nhttps://youtu.be/K7nK3cUwbFk\n\nHopefully this album will be available for streaming as well; typically, since joining [Starwave Records](/labels/starwave-records/), their music has been fairly available internationally, but for whatever reason they stopped uploading after their **Usobeni NO Sou** single.\n\nhttps://vk.gy/releases/la-veil-mizeria/14190/shoku-no-shuuen/\n\n', '2019-02-16 19:03:02', 29, 17241, NULL, NULL, NULL, NULL, 'details-for-laveil-mizerias-first-album-revealed', 0),
(3011, 'CHICKTAK 0th single &ldquo;Sayonara sepia&rdquo;', '(5464)/chicktak/ will put out their 0th single.\n\n*Sayonara sepia*  (*&#12469;&#12520;&#12490;&#65279;&#12521;&#12475;&#12500;&#12450;*) will be released  on April 12th.\n\nhttps://vk.gy/releases/chicktak/15902/sayonara-sepia/', '2019-02-16 19:27:43', 400, 17248, NULL, NULL, NULL, NULL, 'chicktak-new-single-sayonara-sepia', 0),
