(3015, 'GOSSIP to Release Two Final DVDs', '(1487)/gossip-ains/ will put out two new DVDs: one is a live digest DVD, spanning their entire career. The second will contain footage from their last live.\n\nBoth will be released  on March 31st and are available for pre-order on the -AINS- webshop.\n\nhttps://vk.gy/releases/gossip-ains/15978/2014070120181231-01/\n\nhttps://vk.gy/releases/gossip-ains/15977/2018-nen-12-gatsu-31-nichi-gatsu-meguro-rock-may-kan-madwink-presents-gossip-saishuu-tandoku-kouen-gossip/', '2019-02-19 05:14:22', 29, 10683, NULL, NULL, NULL, NULL, 'dainippon-onitanjigumi-akud-kai-ni-senkyo-sare-gossip-new-live-recording-comment-2014070120181231-01', 0),
