(3022, 'IIIRD new maxi-single &ldquo;MISS YOU&rdquo;', '(5401)/iiird/ will put out their debut maxi-single.\n\n*MISS YOU* will be released  on March 27th. It will contain 3 tracks and cost 1,620 yen. (5401)/iiird/ are the newest addition to [PUNCH RECORDS](/labels/punch-records/) roster, although details about the band have not yet been revealed. Rumor is that they&#39;re all ex-(1383)/krad/ members, but that is still to be officially confirmed. \n\nRegardless, Brand-X has this single up for pre-order and describes it as &#34;emotional, depressive metal&#34; (lit: &#22810;&#24773;&#30340;&ne;&#39729;METAL), so break out your black eye liner and get ready to cry!\n\nhttps://www.brand-x.jp/product/12605\n\nhttps://vk.gy/releases/iiird/16226/miss-you/', '2019-02-22 17:27:55', 29, NULL, NULL, NULL, NULL, NULL, 'iiird-new-maxi-single-miss-you', 0),
