(11549, '2019-01-31 13:32:31', NULL, 1, NULL, 11548, 'It does appear that the guitarist for un:slip was named SENA and shares the same birth date, and the guy has a similar face (nose/lips) to JILUKA&#39;s SENA: [see this blog](http://blog.livedoor.jp/unslip/archives/cat_63925.html&#63;p=12). *However*, the guy from un:slip has a tattoo on his right arm, whereas JILUKA SENA doesn&#39;t, at least in the few photos that I found of his bare arm. So unless he got it removed, or covers it with foundation when he&#39;s not covering it with clothing, I guess it&#39;s a different person...', NULL, 3575, 3, 0, 1),
