(11595, '2019-02-11 09:38:24', NULL, 1, NULL, NULL, 'This is something I&#39;ll be posting soon, but I thought I&#39;d give you guys a look first in case you had any questions or suggestions.', NULL, 696, 2, 0, 1),
(11597, '2019-02-11 14:44:01', NULL, 29, NULL, NULL, 'You do so many more steps than I do lmaooo. But this was interesting to learn about, since I just kind of repurpose what I learned in the 1 (one) photo editing class I took in school. (and I&#39;m v. lazy)\n\n\nI just crop, shrink down a bit, and then use the curves tool and up the contrast a bit. If there&#39;s any obnoxious finger prints, dust marks, or creases, I&#39;ll try to remove those out as well. The next set of scans I do, I&#39;ll try this noise reduction feature and see how much of a difference it makes. My worry is that with lyrics, it will make the kanji blurry if they&#39;re printed too small (and let&#39;s be real, booklet graphic designers seem to feel that 6px font is appropriate &#128545;)', NULL, 696, 2, 0, 1),
(11598, '2019-02-11 14:58:58', NULL, NULL, '5c618db25e065', NULL, 'Good Band.', NULL, 4080, 3, 0, 0),
(11602, '2019-02-11 16:20:07', NULL, 303, NULL, NULL, 'Omg thank you so much for this!!! I&#39;ve always had a problem with &#34;dots&#34; coming up in my Merry scans and it was fucking annoying cuz I didn&#39;t know why it was displaying like that or how to fix it!! Thank you so much &hearts;\n\nAs for my scans, I usually tend to auto-contrast it to where it displays correctly (as the scan usually comes out brighter), then straighten it up if necessary, and finally clean it up a bit before I post it. I&#39;m scared to mess with any other features lmao', NULL, 696, 2, 0, 1),
