(11617, '2019-02-12 00:37:04', NULL, 1, NULL, 11597, 'Tbh I&#39;m lazy and just have it saved as an Action that I run right after scanning. You&#39;re right, it can easily make lyrics too blurry--I can&#39;t remember if I use other filters for that, or if I just use the raw scan in that case. I&#39;ll have to look next time I&#39;m home. But yeah, at least for cover art, try it out and let me know how it goes!', NULL, 696, 2, 0, 1),
(11618, '2019-02-12 00:59:09', NULL, 1, NULL, 11605, '@brengun Looks like Hakata DRUM Be-1 *did* exist, but in 1999 they changed location(&#63;) and renamed to Fukuoka DRUM Be-1 (Hakata is an area within Fukuoka, but I guess they moved out of that area). Anyway, I did add Hakata DRUM Be-1 to the database, but since it changed names in 1999, Fukuoka DRUM Be-1 is still correct for this band.\n\n@Laurence02 Thanks for checking on that!', NULL, 4976, 3, 0, 1),
(11619, '2019-02-12 01:24:01', NULL, 1, NULL, 11603, 'I clarified the pages for the various LUCIFERs: (5458)/LUCIFER/ is the newest band, (5457)/Lucifer-90s/ is the early one, (839)/Lucifer-00s/ is early 2000s one, and (5380)/LUCIFER-royz/ is late 2000s one with (237)/Royz/ members.', NULL, 5380, 3, 0, 1),
(11620, '2019-02-12 07:17:14', NULL, 407, NULL, 11605, 'My bad! I didn&#39;t do more than a cursory check and it came back to bite me!', NULL, 4976, 3, 0, 1),
(11621, '2019-02-12 07:25:00', NULL, NULL, '5c6274ccb7545', NULL, '&#12501;&#12449;&#12531;&#12398;&#32207;&#31216;&#12399;&#12502;&#12522;&#12387;&#12371;&#12395;&#27770;&#12414;&#12426;&#12414;&#12375;&#12383;(2019&#24180;2&#26376;12&#26085;&#12398;VISULOG&#12481;&#12515;&#12531;&#12493;&#12523;&#12395;&#12390;&#27770;&#23450;)', NULL, 5275, 3, 0, 1),
(11622, '2019-02-12 19:57:20', NULL, 445, NULL, NULL, 'Thanks for sharing this. Hopefully I can get my scans to looks just as nice now.', NULL, 696, 2, 0, 1),
(11623, '2019-02-14 14:42:35', NULL, 29, NULL, NULL, 'I haven&#39;t avoided paying taxes, but I have avoided making eye contact with someone I&#39;ve hooked up with while bumping into him on the subway. Close&#63;', NULL, 3002, 0, 0, 1),
