(11626, '2019-02-14 18:27:53', NULL, 303, NULL, NULL, 'their concept revolves around being in &#34;the garden of neverland&#34; but their name makes it look more like they really like the Netherlands xD', NULL, 5347, 3, 0, 1),
(11627, '2019-02-14 21:31:22', NULL, 1, NULL, 11626, 'I believe that the &ldquo;nether garden&rdquo; refers to the random picture of all their crotches &#128540;', NULL, 5347, 3, 0, 1),
(11628, '2019-02-15 02:19:57', NULL, 303, NULL, NULL, 'can&#39;t believe he stole spongebob&#39;s pretty patties, that bastard', NULL, 3002, 0, 0, 1),
(11629, '2019-02-16 05:38:01', NULL, 371, NULL, 11404, 'My &#32118;&#28357;&#31278; demotape says SEPHIROT not Sephirot :(', NULL, 2767, 3, 0, 1),
(11630, '2019-02-16 06:16:01', NULL, 1, NULL, 11404, 'I think we found that their early name was Sephirot and later was SEPHIROT. Wish we knew release dates!', NULL, 2767, 3, 0, 1),
(11632, '2019-02-17 03:16:25', NULL, 473, NULL, NULL, 'Fixed the tracklist, some tracks where mixed up.', NULL, 15844, 1, 0, 1),
(11633, '2019-02-17 04:18:14', NULL, 29, NULL, NULL, 'I made this under a profile for Kiyo, since they credited it as &#34;Dear L&#39;Novel Kiyo 1st Maxi-Single&#34;\n\nhttps://vk.gy/releases/kiyo/15842/meccha-fairy-parade/\n\nIt doesn&#39;t look like he did anything else, though, so I&#39;m not sure if it&#39;s worth having a separate artist for just this song.', NULL, 15922, 1, 0, 1),
(11634, '2019-02-17 04:50:44', NULL, 473, NULL, NULL, 'Temporarily took the decision to change the band name to &#34;+SADIST+&#34; due to what i can find in my cds regarding band logos, on the sides of all cds they write them self as &#34;+SADIST+&#34;', NULL, 663, 3, 0, 1),
(11635, '2019-02-19 16:45:04', NULL, 303, NULL, NULL, 'It&#39;s available on Puresound! We&#39;ve been blessed! &hearts;', NULL, 14878, 1, 0, 1),
(11636, '2019-02-20 13:48:44', NULL, 499, NULL, NULL, 'Got the information from the band on Instagram : their correct name is &#34;La mis&egrave; a mourl&eacute;&#34;. So I correct it here.', NULL, 4599, 3, 0, 1),
(11637, '2019-02-20 13:51:29', NULL, 1, '5c6d5b611cdb0', 11636, 'Great job!!', NULL, 4599, 3, 0, 1),
(11638, '2019-02-20 17:08:28', NULL, NULL, '5c6d898c7c9c2', NULL, 'guitarist SHIGE&#62;SIDE&#62;seraph eyeglace&#62;Rafflesia(kazane)&#62;R(kazane)&#62;misery(kazane)', NULL, 1364, 3, 1, 0),
(11639, '2019-02-20 17:08:56', NULL, 303, NULL, NULL, 'Honestly I&#39;ve always questioned how yall romanized things here, but this clears it up! The katakana/kanji mixing for ~*aesthetics*~ makes a lot more sense. Thanks a lot and sorry for judging xD &hearts;', NULL, 703, 2, 0, 1),
(11640, '2019-02-20 17:11:33', NULL, NULL, '5c6d898c7c9c2', NULL, 'guitarist SHIGE&#62;RX-7&#62;SIDE&#62;seraph eyeglace&#62;Rafflesia(kazane)&#62;R(kazane)&#62;misery(kazane)', NULL, 1364, 3, 0, 1),
(11641, '2019-02-20 17:24:13', NULL, NULL, '5c6d898c7c9c2', NULL, 'Vocalist NAO=kanai(&#21494;)', NULL, 1571, 3, 0, 1),
(11642, '2019-02-20 18:35:05', NULL, 29, NULL, NULL, 'Regarding hyphens: are there cases where they are warranted if they are not included in the title&#63; For example, I often dash things that are suffixes but I am not sure if that is correct. \n\n&#21021;&#22238;&#38480;&#23450;&#30058; --&#62; Shokai Gentei-ban (since &#34;ban&#34; is a suffix here for &#34;type&#34;),\n\n&#38745;&#12363;&#12394;&#35199;&#29916; --&#62; Shizuka-na Suika ( since &#34;na&#34; is the suffix marker for an adjective. This example I mostly feel is incorrect),  \n\nV&#31995;&#30340; --&#62; V-Kei-teki (kind of a double whammy, as -kei is a suffix for &#34;system&#34; and -teki in this usage is a suffix for &#34;typical of&#34; or &#34;-like&#34;).', NULL, 703, 2, 0, 1),
(11643, '2019-02-21 02:06:28', NULL, 1, NULL, 11640, 'Thank you! Updated.', NULL, 1364, 3, 0, 1),
(11644, '2019-02-21 04:32:19', NULL, 29, NULL, NULL, 'Every time I stumble upon this omnibus I get so angry because of how much wasted potential there was.\n\n\nMaybe it got canceled because Yayoi was in 3 of the 19 bands listed and couldn&#39;t be bothered', NULL, 2835, 1, 0, 1),
(11645, '2019-02-21 08:58:06', NULL, 407, NULL, 11642, 'I also use hyphens for -ban and -teki, but I can&#39;t recall whether I use them for anything else. As &#34;na&#34;, &#34;o&#34;, or &#34;e&#34; most prominently are particles and not suffixes per se (though they are suffix markers), I typically do not have hyphens before them.', NULL, 703, 2, 0, 1),
(11646, '2019-02-21 17:06:46', NULL, 407, NULL, NULL, 'This band is like the personification of determination. Can&#39;t play in live houses&#63; Let&#39;s play on the street!', NULL, 5510, 3, 0, 1),
(11647, '2019-02-21 19:26:17', NULL, 29, NULL, 11646, 'At least their last live was held inside :&#39;)', NULL, 5510, 3, 0, 1),
(11648, '2019-02-21 22:20:06', NULL, 499, NULL, NULL, 'Maybe it should be &#34;deep t&eacute;n&egrave;bres&#34; &#63; That&#39;s making more sense, no &#63;', NULL, 5510, 3, 0, 1),
(11649, '2019-02-22 01:00:43', NULL, 1, '5c6f49bb26dcf', 11648, 'Their OHP uses separate characters, but they *do* use the grave and acute accents... So I guess they probably intend the spelling that you said&#63; Wish we could see their logo!\n\nAnyway, in this case I think it might be ok to change it. You can just put a note in their biography that it might be spelled either way.', NULL, 5510, 3, 0, 1),
(11650, '2019-02-22 05:22:58', NULL, 1, NULL, NULL, 'How did it take me until their disbandment to find out that one of their members is ex-(3271)/forCroix/!&#63; &#128557;', NULL, 3021, 0, 0, 1),
(11651, '2019-02-22 19:17:19', NULL, 407, NULL, NULL, 'Help me with the members please!', NULL, 263, 3, 0, 1),
(11652, '2019-02-22 20:08:31', NULL, 29, NULL, NULL, 'Th&euml;y r&euml;&auml;ll&yuml; l&iuml;k&euml; &auml;cc&euml;nt&scaron;', NULL, 4630, 3, 0, 1),
(11653, '2019-02-24 19:49:44', NULL, 29, NULL, NULL, 'After digging around their archived OHP, I found out that they linked to a [Pierrot Fansite](http://web.archive.org/web/20021024103438/http://www.geocities.co.jp/Bookend-Christie/3378/index.html) which they dubbed their &#34;Fun site&#34; (it was fun in contrast to the other two links, which were &#34;official&#34; and &#34;other&#34;).\n\n(Why they had a link to their official site _within_ their official site is beyond me, but 2004 was a wild time in web development)', NULL, 2355, 3, 0, 1);

