(1428, '&#21488;&#28286;&#12513;&#12483;&#12475;&#12540;&#12472;DVD', 'Taiwan MESSAGE DVD', 'taiwan-message-dvd', 5, '2014-08-28', 0, NULL, NULL, 0, 0, '3,500 yen', NULL, '(DVD-R)', 'comment', NULL, NULL, 'lives only', 'complete limited pressing', '10', '(14)', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1529, 'This comment DVD-R was awarded to those who spent 3,500 yen on (5)/LIN/&#39;s goods at their 2014-08-28 live at Umeda (&#26757;&#30000;) AKASO. The comment was recorded during the band&#39;s performance in Taiwan earlier in that year.', NULL, 1, NULL, NULL, NULL, 0, 0, 1, 1, NULL, NULL, NULL, NULL, NULL),
(1435, 'kisaki MEMORIAL PHOTO BOOK', NULL, 'kisaki-memorial-photo-book', 10, '2007-06-30', 0, NULL, NULL, 0, 0, '5,000 yen', NULL, '(book)', 'photography', NULL, NULL, 'select stores only', 'not for sale', NULL, '(1)', '(55)', NULL, NULL, NULL, NULL, NULL, NULL, 0, 1531, 'This pamphlet was awarded to those who spent 5,000 yen on (10)/Phantasmagoria/ &times; ID-JAPAN collaborative memorial goods starting 2007-06-30. The pamphlet features 24 pages with large, full-color images of each of Phantasmagoria&#39;s costume sets (with a particular focus on KISAKI&#39;s costumes). The band&#39;s permanent costume designer, SAWACO, provides short comments on each. The last page features offshot photos of the band&#39;s visit to an ID-JAPAN store.', NULL, 1, NULL, NULL, NULL, 0, 0, 1, 1, NULL, NULL, NULL, NULL, NULL),
