(1460, 'Recollection of Phoenix', NULL, 'recollection-of-phoenix', 5, '2014-12-24', 0, NULL, NULL, 0, 0, '2,500 yen', 'SVCD-001', '(CD)', 'mini-album', 'Re-Recording MINI-ALBUM', NULL, 'available everywhere', NULL, NULL, '(70)', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1533, NULL, 'PRODUCED - &#20955;\r\n\r\nSOUND DIRECTION - KISAKI &#47; YOSHIHISA SHIRAKAWA (white Great wall)\r\nRECORDING STUDIO - Pacific Studio\r\nRECORDING ENGINEER - MASAYUKI ISHIWATA\r\nMASTERING STUDIO - ARS STUDIO\r\nMASTERING ENGINEER - KATSUHIRO YAMAMOTO (DETRO)\r\nARTIST MANAGEMENT - TOMOMI MAEGAWA &#47; DAIJIRO NAKANISHI\r\nSTAGE DIRECTOR - SHINSUKE OTSUKA &#47; FU WEI CHENG\r\nGUITAR & BASS TECHNICIAN - ESP\r\nROAD CREW - &#25105;&#20799; (Paranoid&ne;circuS)\r\nARTIST PHOTO HAIR MAKE - A&#12539;DO (Tritt fur Tritt)\r\nLIVE HAIR MAKE - A&#12539;DO (Tritt fur Tritt) &#47; NAOYA KAWAMURA (Tritt fur Tritt) &#47; AIKO INADA (Tritt fur Tritt) &#47; CHIHO KOBAYASH\r\nCOSTUME - ID-JAPAN\r\nCOSTUME DESIGNER - SAWAKO SATO (ID-JAPAN)\r\nCOSTUME SUPERVISOR - HIDEFUMI SATO (ID-JAPAN)\r\nNAILIST - AKI YAMAMOTO\r\nPHOTOGRAPHER - AKIO YOKOYAMA (BETTER-THINGS)\r\nGRAPHIC DESIGNER - AKI OKAMURA (KSI)\r\nSUPERVISOR - NOBUHIRO YAMAMOTO (wyze iD factory Inc.)\r\n\r\nSPECIAL THANKS - RIKU &#47; KANATA &#47; MIZUKI &#47; REIYA', 1, NULL, NULL, NULL, 0, 0, 1, 0, NULL, NULL, NULL, NULL, NULL),
(1468, '&#12300;&#12511;&#12470;&#12467;&&#12475;&#12525;&#12479;&#12473;&#12301;&#12513;&#12483;&#12475;&#12540;&#12472;DVD', '&#12300;MIZAKO & CEROTASU&#12301; MESSAGE DVD', 'mizako-cerotasu-message-dvd', 5, '2014-09-13', 0, NULL, NULL, 0, 0, '4,000 yen', NULL, '(DVD-R)', 'comment', NULL, NULL, 'lives only', 'complete limited pressing', '20', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1534, 'This comment DVD-R was awarded to the first 20 people to spend 4,000 yen on (5)/LIN/ goods at their 2014-09-13 and 2014-09-15 shows. It features a comment from &ldquo;MIZAKO and CEROTASU&rdquo;&#8213;alter-egos of guitarists MIZALY and CERO.', NULL, 1, NULL, NULL, NULL, 0, 0, 1, 1, NULL, NULL, NULL, NULL, NULL),
