(2013, 'REINCARNATION ~&#24187;&#24433;&#20687;&#23436;&#20840;&#30436;~', 'REINCARNATION ~Geneizou Kanzenban~', 'reincarnation-geneizou-kanzenban', 10, '2007-09-05', 0, NULL, NULL, 0, 0, '5,040 yen', 'UCDV-048', '(DVD)', 'PV', NULL, NULL, 'available everywhere', NULL, NULL, '(1)', NULL, '(4)', '(4)', NULL, NULL, NULL, NULL, 0, NULL, 'This memorial DVD is the &ldquo;complete edition&rdquo; of (10)/Phantasmagoria/&#39;s *Geneizou* series. It compiles most PVs from previous DVDs in the series, plus a bonus selection of live footage from the Phantasmagoria &times; (53)/VIDOLL/ event series, *Genei Bijinkan*.\n---\nThe DVD is packaged in a special cardboard slipcase, and each copy contains a random trading card and present application coupon.', NULL, 1, 0, NULL, NULL, 0, 0, 1, 0, NULL, NULL, NULL, NULL, NULL),
(2014, 'CRYSTAL FINALE 2007.8.27 &#28171;&#35895;SHIBUYA-AX', 'CRYSTAL FINALE 2007.8.27 Tokyo SHIBUYA-AX', 'crystal-finale-2007-8-27-tokyo-shibuya-ax', 10, '2007-10-31', 0, NULL, NULL, 1, 2, '7,875 yen', 'UCDV-049', '(DVD)', 'live recording', NULL, NULL, 'available everywhere', NULL, NULL, '(1)', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 'This 2 DVD set features (10)/Phantasmagoria/&#39;s oneman at SHIBUYA-AX&#8213;their second-to-last live before pausing activities. The second disc contains their shorter oneman at Nakano SUN PLAZA.\n---\nThe included booklet is a 16 page &ldquo;history book&rdquo; which lists the band&#39;s discography, biography, and live history.', NULL, 1, 0, NULL, NULL, 0, 0, 1, 0, NULL, NULL, NULL, NULL, NULL),
