(2044, '&#12300;&#24187;&#24433;&#32654;&#20154;&#39208;&#12301; ~&#29305;&#21029;&#22812;~ 2007.1.27 &#24029;&#23822;CLUB CITTA&#39;', '&#12300;Genei Bijinkan&#12301; ~Tokubetsuyoru~ 2007.1.27 Kawasaki CLUB CITTA&#39;', 'genei-bijinkan-tokubetsuyoru-2007-1-27-kawasaki-club-citta', 10, '2007-04-29', 0, NULL, NULL, 0, 0, '2,625 yen', 'UCPD-022', '(DVD)', 'live recording', NULL, NULL, 'lives only', 'complete limited pressing', NULL, '(1)', '(53)', NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 'This DVD contains footage of (10)/Phantasmagoria/ from their twoman with (53)/VIDOLL/, *Genei Bijinkan ~Tokubetsuyoru~*, from 2007-01-27 at Kawasaki CLUB CITTA&#39;. The DVD was sold at lives beginning on 2007-04-29.', NULL, 1, 0, NULL, NULL, 0, 0, 1, 0, NULL, NULL, NULL, NULL, NULL),
(2045, '&#12300;&#24187;&#24433;&#32654;&#20154;&#39208;&#12301; ~&#29305;&#21029;&#22812;~ 2007.1.27 &#24029;&#23822;CLUB CITTA&#39;', '&#12300;Genei Bijinkan&#12301; ~Tokubetsuyoru~ 2007.1.27 Kawasaki CLUB CITTA&#39;', 'genei-bijinkan-tokubetsuyoru-2007-1-27-kawasaki-club-citta', 10, '2007-08-29', 0, NULL, NULL, 0, 0, '2,625 yen', 'UCPD-022B', '(DVD)', 'live recording', NULL, NULL, 'available everywhere', 'complete limited pressing', NULL, '(1)', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 'This is a second press of [this DVD][1]. Unlike the first press, this version was available in normal stores, and included an obi/title strip. Otherwise, the contents are the same.\n\n [1]: http://weloveucp.com/releases/phantasmagoria/2044/genei-bijinkan-tokubetsuyoru-2007-1-27-kawasaki-club-citta/', NULL, 1, 0, '&#27969;&#36890;&#30436;', 'Ryuutsuuban', 0, 0, 1, 0, NULL, NULL, NULL, NULL, NULL),
(2049, 'Making of &#31070;&#21109;&#26354;-Variant Jihad-', 'Making of Shinsoukyoku -Variant Jihad-', 'making-of-shinsoukyoku-variant-jihad', 10, '2006-12-17', 0, NULL, NULL, 1, 5, '0 yen', 'UCPD-017', '(DVD)', 'other', NULL, NULL, 'lives only', 'not for sale', NULL, '(1)', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 'This DVD was freely distributed to attendees of the band&#39;s 2006-12-17 oneman, *Black-Veil Before Christmas*, at Tokyo LAFORET MUSEUM ROPPONGI. Additional quantities were later sold through shops.', NULL, 1, 0, NULL, NULL, 0, 0, 1, 0, NULL, NULL, NULL, NULL, NULL),
(2051, '-&#25391;&#12426;&#20184;&#12369;(&#63;)DVD &#31532;&#19977;&#24382;!!- Glitter', '-Furitsuke(&#63;)DVD Daisandan!!- Glitter', 'furitsuke-dvd-daisandan-glitter', 10, '2006-11-17', 0, NULL, NULL, 0, 0, '1,500 yen', 'UCPD-013', '(DVD)', 'other', NULL, NULL, 'lives only', 'complete limited pressing', NULL, '(1)', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 'This DVD was sold at (10)/Phantasmagoria/ guitarist JUN&#39;s birthday event, *JUN Seitan Matsuri ~Kyou dake JUn ga Kami ni Naru~*, at SITE KOBE. It contains footage of RIKU (and guests) teaching the furitsuke for *Glitter*.\n---\nAlthough the DVD lists this as the third furitsuke video by Phantasmagoria, it seems to have been the second... I can&#39;t find any evidence of a third ever existing.\n---\nUnsold quantities were later sold at other lives and in stores.', NULL, 1, 0, NULL, NULL, 0, 0, 1, 0, NULL, NULL, NULL, NULL, NULL),
(2052, '&#31070;&#34955; &#20013;&#37326;&#12469;&#12531;&#12503;&#12521;&#12470;&#38480;&#23450;VERSION', 'Kamibukuro Nakano SUN PLAZA Gentei VERSION', 'kamibukuro-nakano-sun-plaza-gentei-version', 10, '2007-07-14', 0, NULL, NULL, 0, 0, '3,00 yen', NULL, '(box set)', 'other', NULL, NULL, 'lives only', 'complete limited pressing', '200', '(1)', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 'This &ldquo;God bag&rdquo; (a play on the &ldquo;lucky bags&rdquo; that UNDER CODE often sold) was sold at (10)/Phantasmagoria/&#39;s 2007-07-14 oneman, *-LAST LETTERS-*, at Nakano SUN PLAZA. It contained 20,000 yen&#39;s worth of Phantasmagoria-related items, plus an exclusive DVD of the band&#39;s secret first live on 2004-12-05 at ESAKA MUSE.', NULL, 1, 0, NULL, NULL, 0, 0, 1, 0, NULL, NULL, NULL, NULL, NULL),
(2064, '&#36092;&#20837;&#29305;&#20856;CD', 'Kounyuu Tokuten CD', 'kounyuu-tokuten-cd', 10, '2007-11-19', 0, NULL, NULL, 0, 0, '0 yen', NULL, '(CD)', 'live recording', NULL, NULL, 'mail-order only', 'not for sale', NULL, '(1)', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 'This CD was awarded to those who mailed in privilege application coupons from the band&#39;s memorial items: [REQUIEM -FUNERAL EDITION-][1], [REQUIEM -FLORAL EDITION-][2], and [REINCARNATION ~Geneizou Kanzenban~][3]. It contains two recordings from the band&#39;s rehearsal just before their &ldquo;activity seal&rdquo; live on 2007-08-31.\n---\nA number of random CDs were signed by KISAKI.\n---\nRemaining quantities were later sold via shops for 1,000 yen.\n\n [1]: http://weloveucp.com/releases/phantasmagoria/68/requiem-funeral-edition/\n [2]: http://weloveucp.com/releases/phantasmagoria/67/requiem-floral-edition/\n [3]: http://weloveucp.com/releases/phantasmagoria/2013/reincarnation-geneizou-kanzenban/', NULL, 1, 0, NULL, NULL, 0, 0, 1, 1, NULL, NULL, NULL, NULL, NULL),
