(2103, '2013.04.01 &#28171;&#35895;REX', '2013.04.01 Shibuya REX', '2013-04-01-shibuya-rex', 5, '2015-09-20', 0, NULL, NULL, 0, 0, '2,500 yen', NULL, '(DVD-R)', 'live recording', NULL, NULL, 'official web shop only', 'not for sale', '5', '(14)', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, 1, 0, NULL, NULL, 0, 0, 1, 1, NULL, NULL, NULL, NULL, NULL),
(2104, '2011.01.08 HOLIDAY OSAKA', NULL, '2011-01-08-holiday-osaka', 5, '2015-09-21', 0, NULL, NULL, 1, 5, '3,000 yen', NULL, '(DVD-R)', 'live recording', NULL, NULL, 'official web shop only', 'not for sale', '1', '(14)', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 'This DVD-R features footage from the band&#39;s 2011-01-08 live at HOLIDAY OSAKA, *Emergency of new age warrior*.', NULL, 1, 0, NULL, NULL, 0, 0, 1, 1, NULL, NULL, NULL, NULL, NULL),
(2131, 'The End of Corruption World 2010-2015', NULL, 'the-end-of-corruption-world', 5, '2016-02-24', 0, NULL, NULL, 1, 5, '10,800 yen', 'SVCD-004A~E', '(box set)', 'collection album', NULL, NULL, 'available everywhere', 'initial complete limited pressing', NULL, '(70)', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 1911, 'This is (5)/LIN/&#39;s best box, which memorializes both periods of the band.\n---\nIt includes two CDs with remastered versions of previously-released songs, plus a third CD containing a new instrumental version of *World In Flames*. (The third CD is &ldquo;limited to the first press&rdquo;, tho no second press is planned.) The remastering was performed by DETRO STUDIO, but mostly sounds the same as the original versions. The set further includes two DVDs, with full footage of the last oneman of each period of the band. The last oneman footage of first period LIN is exactly the same as the original [Obscure Ideal ~Judgement of fortune~][1] release&#8213;except that this version has no offshot footage, and no credits. A 24-page (mostly plain) booklet is included, as is 1 random trading photocard (of 12 possible). The entire package is contained within a shrinkwrapped cardboard box (17 cm &times; 22 cm&#8213;slightly smaller than Japanese B5 size).\n---\nWhen the release was announced, it was supposed to include 1 signed trading sticker, of 6 possible. This was changed to an unsigned photocard, of which 12 are possible. There was also supposed to be one DVD chronicling the last lives of both lineups (60 min each), but this was later changed to 2 DVDs, one for each lineup, with full footage.\n---\nPLUG RECORDS west is listed in the credits of this release, but I think they were only involved in licensing some of the songs (as Second Period LIN left PLUG RECORDS west for wyze iD factory Inc.). HAUNTED HOUSE is also listed, but I&#39;m not sure of their involvement... They seem to be a live production/band support company that popped up in 2015, and has so far only worked with older musicians (eg. MORRIE). Their only connections to LIN seem to be this release and a March 2016 live at which LIN members will hold a session band. The company seems to be often involved in goods production, so I wonder if they facilitated the production of this box set. I also wonder if they&#39;re related to HAUNTED HOUSE RECORDS, which was a sublabel of UNDER CODE PRODUCTION created exclusively for the release of [FLESH FOR FLANKENSTEIN][2]. Please leave a comment if you have any information!\n---\nThose who purchased through the official web shop further received a customized message DVD from the member of their choice. Originally, this privilege was exclusive to those who pre-ordered, but the offer was extended to orders placed through May 2016.\n\n [1]: http://weloveucp.com/releases/lin/553/obscure-ideal-judgement-of-fortune-2013-6-30-osaka-big-cat/\n [2]: http://weloveucp.com/releases/flesh-for-flankenstein/1209/dj-flankenstein/', NULL, 1, 0, NULL, NULL, 0, 0, 1, 0, 'jewel case w&#47; clear tray', '4529123340566', NULL, NULL, NULL),
