(2364, '2009.10.23 &#24515;&#25998;&#27211;FANJ-twice &#12300;Sympathize with One&#39;s Voice&#12301;', '2009.10.23 Shinsaibashi FANJ-twice &#12300;Sympathize with One&#39;s Voice&#12301;', '2009-10-23-shinsaibashi-fanj-twice-sympathize-with-one-s-voice', 1, '2016-04-10', 0, NULL, NULL, 0, 0, '3,240 yen', '091023-MEGA', '(DVD-R)', 'live recording', NULL, NULL, 'official web shop only', 'complete limited pressing', NULL, '(14)', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 'This bootleg DVD-R was sold during the (5)/LIN/ webshop&#39;s last fair. It contains footage of Megaromania&#39;s appearance at their coupling event with (18)/Arc/, *Sympathize with One&#39;s Voice*, on 2009-10-23 at Shinsaibashi (&#24515;&#25998;&#27211;) FANJ-twice.\n---\nThe tracklisting is unknown.', NULL, 303, 0, NULL, NULL, 0, 0, 1, 0, 'jewel case w&#47; clear tray', NULL, NULL, NULL, NULL),
(2365, '2012.12.31~2013.01.01 &#24515;&#25998;&#27211;FANJ-twice &#12300;&#38306;&#35199;&#21046;&#22311;FINAL 2012~2013&#12301;', '2012.12.31~2013.01.01 Shinsaibashi FANJ-twice &#12300;Kansai Seiatsu FINAL 2012~2013&#12301;', '2012-12-31-2013-01-01-shinsaibashi-fanj-twice-kansai-seiatsu-final-2012-2013', 1, '2016-04-10', 0, NULL, NULL, 0, 0, '3,240 yen', '121231-MEGA', '(DVD-R)', 'live recording', NULL, NULL, 'official web shop only', 'complete limited pressing', NULL, '(14)', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 'This official bootleg live DVD-R was sold via the (5)/LIN/ official web shop during its last fair. The footage was recorded at the UNDER CODE PRODUCTION last New Year countdown event, *Kansai Seiatsu FINAL 2012~2013* (*&#38306;&#35199;&#21046;&#22311;FINAL 2012~2013*), at Shinsaibashi (&#24515;&#25998;&#27211;) FANJ-twice. The tracklisting is unknown (tho it&#39;s probably 4 songs).', NULL, 303, 0, NULL, NULL, 0, 0, 1, 0, 'jewel case w&#47; clear tray', NULL, NULL, NULL, NULL),
(2373, '2015.7.01 &#39640;&#30000;&#39340;&#22580;AREA', '2015.7.01 Takadanobaba AREA', '2015-7-01-takadanobaba-area', 5, '2015-07-31', 0, NULL, NULL, 0, 0, '3,000 yen', NULL, '(DVD-R)', 'live recording', NULL, NULL, 'lives only', 'complete limited pressing', '3', '(14)', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 'This official bootleg live DVD-R was sold at LIN&#39;s 2015-07-31 live at SHIBUYA-REX, during the *V-BAND &#31085; ~SUMMER FESTIVAL 2015~* (*V-BAND Matsuri ~SUMMER FESTIVAL 2015~*) event. The footage is of LIN&#39;s appearance at the Grieva (&#12464;&#12522;&#12540;&#12532;&#12449;) sponsored event, *Yamishi-Ni-* (*&#38343;&#24066;-&#24336;-*), on 2015-07-01 at Takadanobaba (&#39640;&#30000;&#39340;&#22580;) AREA.', NULL, 1, 0, NULL, NULL, 0, 0, 1, 1, 'jewel case w&#47; clear tray', NULL, NULL, NULL, NULL),
(2374, '2015.6.30 &#30446;&#40658;&#40575;&#40180;&#39208;', '2015.6.30 Meguro ROCKMAYKAN', '2015-6-30-meguro-rockmaykan', 5, '2015-07-31', 0, NULL, NULL, 0, 0, '3,000 yen', NULL, '(DVD-R)', 'live recording', NULL, NULL, 'lives only', 'complete limited pressing', '3', '(14)', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 'This official bootleg live DVD-R was sold at LIN&#39;s 2015-07-31 live at SHIBUYA-REX, during the *V-BAND &#31085; ~SUMMER FESTIVAL 2015~* (*V-BAND Matsuri ~SUMMER FESTIVAL 2015~*) event. The footage is from LIN&#39;s threeman, *Blazing Triangulum*, on 2015-06-30 at Meguro (&#30446;&#40658;) ROCKMAYKAN (&#40575;&#40180;&#39208;).', NULL, 1, 0, NULL, NULL, 0, 0, 1, 1, 'jewel case w&#47; clear tray', NULL, NULL, NULL, NULL),
(2375, '&#12458;&#12522;&#12472;&#12490;&#12523;&#12496;&#12483;&#12464; &#12488;&#12524;&#12540;&#12487;&#12451;&#12531;&#12464;LIVE DVD', 'ORIGINAL BAG TRADING LIVE DVD', 'original-bag-trading-live-dvd-type-a', 5, '2016-03-20', 0, '2012.8.31 &#26757;&#30000;&#12471;&#12515;&#12531;&#12464;&#12522;&#12521;', '2012.8.31 Umeda SHANGRI-LA', 0, 0, '4,000 yen', NULL, '(DVD-R)', 'live recording', NULL, NULL, 'lives only', 'complete limited pressing', '50', '(14)', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 'This is one version of the &ldquo;trading DVD&rdquo; that was included in (5)/LIN/ totebags which were sold at their 2016-03-20 last live at Nanba (&#38627;&#27874;) Hatch. There were 7 versions in total, each distributed randomly. After that live, remaining stock of a &ldquo;Maria&rdquo; design t-shirt was sold via the official web shop; each shirt was paired with 1 random DVD, of the same set used in the totebags.\n---\nThis particular DVD features footage from First Period LIN&#39;s performance on 2012-08-31 at Umeda (&#26757;&#30000;) SHANGRI-LA, during the *SUMMER MASQUERADE FINAL ~Phantasmagoria MEMORIAL TRIBUTE NIGHT~* event. The final song was a large session including members of LIN, (2)/NEGA/, (1)/Megaromania/, (3)/Cu[be]/, (7)/FUTURISM&#12539;BOYZ/, (14)/Dali/, (16)/SUZAKU/, (17)/CindyKate/, (4)/REALies/, and (9)/Vior gloire/.\n---\nThe footage on this DVD was [previously released on 2013-09-24][1]. The footage on this version appears to be the same, but the artwork on the DVD itself is different.\n\n [1]: http://weloveucp.com/releases/lin/775/2012-08-31-umeda-shangri-la-summer-masquerade-final-phantasnagoria-memorial-tribute-night/', NULL, 1, 0, NULL, NULL, 0, 0, 1, 1, 'jewel case w&#47; clear tray', NULL, NULL, NULL, NULL),
(2376, '&#12458;&#12522;&#12472;&#12490;&#12523;&#12496;&#12483;&#12464; &#12488;&#12524;&#12540;&#12487;&#12451;&#12531;&#12464;LIVE DVD', 'ORIGINAL BAG TRADING LIVE DVD', 'original-bag-trading-live-dvd-type-b', 5, '2016-03-20', 0, 'TYPE B', NULL, 1, 5, '4,000 yen', NULL, '(DVD-R)', 'live recording', NULL, NULL, 'lives only', 'complete limited pressing', '50', '(14)', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 'This &ldquo;trading DVD&rdquo; (official bootleg live DVD) was included in the LIN original totebag that was sold at the band&#39;s last live, *the end of corruption world*, on 2016-03-20 at Nanba (&#38627;&#27874;) Hatch. Each totebag contained 1 random DVD, of 7 possible. Each DVD contains footage from either 1st or 2nd Period LIN&#8213;the recording dates and tracklistings of each DVD have not been revealed.', NULL, 1, 0, NULL, NULL, 0, 0, 1, 1, 'jewel case w&#47; clear tray', NULL, NULL, NULL, NULL),
