(2385, '2011.7.20 &#26032;&#23487;RUIDO K-4 &#12450;&#12491;&#12510;&#12523;BOYS2011', '2011.7.20 Shinjuku RUIDO K-4 ANIMAL BOYS 2011', '2011-7-20-shinjuku-ruido-k-4-animal-boys-2011', 5, '2013-09-24', 0, NULL, NULL, 0, 0, NULL, NULL, '(DVD-R)', 'live recording', NULL, NULL, 'official web shop only', 'not for sale', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 2072, 'This DVD-R features footage of the session band ANIMAL BOYS2011 (&#12450;&#12491;&#12510;&#12523;BOYS2011) from their appearance at the LIN sponsored event, *Rinnatsumatsuri ~Shinjukuhen~* (*&#20955;&#22799;&#31085;~&#26032;&#23487;&#32232;~*), on 2011-07-20 at Shinjuku (&#26032;&#23487;) RUIDO-K4.\n---\n&#12304;lineup&#12305; V. KAIRI (&#12459;&#12452;&#12522;) [ex-(55)/SIVA/~Lucky13] / G. Yuichi (&#38596;&#19968;) [ex-SIVA~Lucky13] / G. &#34584;&#24433;-Chikage- [/Megaromanai/] / B. &#27703;&#29273;-Hyoga- [Megaromania] / D. REIYA [LIN&#92;] &#92;[*&#92;] The particulars (release date, price, etc.) of this release are unknown... I *assume* it was released at the same time as [LIN&#39;s footage from the same live][1]&#8213;but I&#39;m not sure. A [one-track version][2] of the DVD was released as a gachagacha present on 2011-08-07, but this is the full version.\n\n [1]: http://weloveucp.com/releases/lin/774/2011-07-20-shinjuku-ruido-k4-lin-natsu-matsuri-shinjuku-hen/\n [2]: http://weloveucp.com/releases/lin/133/2011-07-20-shinjuku-ruido-k4/', NULL, 74, 0, NULL, NULL, 0, 0, 1, 0, 'jewel case w&#47; clear tray', NULL, NULL, NULL, NULL),
