(2645, '&#31119;&#34955;&#38480;&#23450;BOOTLEG LIVE DVD 2014.6.01 &#27744;&#34955;LIVE IN ROSA', 'Fukubukuro Gentei BOOTLEG LIVE DVD 2014.6.01 Ikebukuro LIVE IN ROSA', 'fukubukuro-gentei-bootleg-live-dvd-2014-6-01-ikebukuro-live-in-rosa', 5, '2016-06-01', 0, NULL, NULL, 0, 0, '0 yen', NULL, '(DVD-R)', 'collection album', NULL, NULL, 'official web shop only', 'not for sale', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 2203, 'This DVD-R was included in LIN lucky bags purchased from their official web shop after 2016-06-01. (Not all bags included this DVD&#8213;not sure if there was a specific condition that had to be met, or if the web shop just accidentally left it out of some.) It collects the complete (professionally shot) footage from their 2014-06-01 live at Ikebukuro (&#27744;&#34955;) LIVE IN ROSA, which had previously only been available on 4 separate live-limited DVDs. It also, for some reason, includes the *Chaotic Resistance* live PV (which uses footage from the same live), and the *Sacred Xanadu* PV.', NULL, 1, 0, NULL, NULL, 0, 0, 1, 0, 'jewel case w&#47; clear tray', NULL, NULL, NULL, NULL),
(2864, '2010.2.26 &#39640;&#30000;&#39340;&#22580;AREA &#12522;&#12495;&#12540;&#12469;&#12523;&#26144;&#20687;', '2010.2.26 Takadanobaba AREA Rehearsal Eizou', 'megaro-rehearsal', 1, '2010-02-26', 0, NULL, NULL, 0, 0, '0 yen', NULL, '(DVD-R)', 'live recording', NULL, NULL, 'lives only', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 2331, NULL, NULL, 303, 0, NULL, NULL, 0, 0, 1, 0, 'jewel case w&#47; clear tray', NULL, NULL, NULL, NULL),
